import React from 'react';



class Navbar extends React.Component {



  render() {

    return (

      <nav class="navbar navbar-inverse navbar-static-top">
        <div class="navbar-header">
          <button type="button" class="navbar-toggle collapsed" data-toggle="collapse" data-target="#my-nav">
            <span class="sr-only">Toggle navigation</span>
            <span class="icon-bar"></span>
            <span class="icon-bar"></span>
            <span class="icon-bar"></span>
          </button>
          <a class="navbar-brand" href="#">Kieran Harding's Portfolio</a>
        </div>

        <div class="collapse navbar-collapse" id="my-nav">
          <ul class="nav navbar-nav">
            <li><a href="#about">Who I am</a></li>
            <li><a href="#example">My Work</a></li>
          </ul>
        </div>
      </nav>

    )
  }
}

export default Navbar;

